import React from 'react'

export default function Headline() {
  return(
    <div className="newsHeadline">
      <div className="headline">
        <div className="nameSubreddit"></div>
        <div className="headlineSubreddit"></div>
      </div>
      <div className="newsThumbnail"></div>
    </div>
  )
}
